import React, { useEffect } from "react";
import { useDispatch } from "react-redux";
import { ADD_TO_ORDED } from "./store/reducer";

const AddToOrder = (order) => (dispatch = useDispatch) => {
  dispatch({ type: ADD_TO_ORDED, payload: order });
};

export default function Menu() {
  const arr = ["aaa", "bbb", "ccc", "ddd", "eee"];

  useEffect(() => {
    arr.forEach((element) => {
      AddToOrder(element);
    });
  });

  return <div>menua</div>;
}
